import React from "react";
import { FaSearch } from "react-icons/fa";
import { Card, CardContent } from "@/components/ui/card";
import { Button } from "@/components/ui/button";

const Navbar = () => (
  <nav className="bg-purple-700 text-white p-4 flex justify-between items-center">
    <h1 className="text-xl font-bold">The Media Ant</h1>
    <div className="flex items-center bg-white text-black px-2 py-1 rounded-md">
      <input type="text" placeholder="Search Channel, Media" className="outline-none" />
      <FaSearch />
    </div>
    <div className="space-x-4">
      <Button variant="outline">Contact Us</Button>
      <Button>Login</Button>
      <Button>Your Bag</Button>
    </div>
  </nav>
);

const HeroSection = () => (
  <section className="bg-purple-600 text-white p-8 text-center">
    <h2 className="text-3xl font-bold">Empowering All To Advertise</h2>
    <p className="mt-2">Buy best media Ad</p>
    <div className="flex justify-center gap-6 mt-6">
      <Card className="p-4">
        <CardContent>
          <h3 className="text-xl font-semibold">Find</h3>
          <p>Media Rates</p>
        </CardContent>
      </Card>
      <Card className="p-4">
        <CardContent>
          <h3 className="text-xl font-semibold">Plan</h3>
          <p>Media Spend</p>
        </CardContent>
      </Card>
      <Card className="p-4">
        <CardContent>
          <h3 className="text-xl font-semibold">Buy</h3>
          <p>Media Spots</p>
        </CardContent>
      </Card>
    </div>
  </section>
);

const AdBanner = () => (
  <div className="bg-indigo-900 text-white p-4 mt-4 text-center">
    <p className="text-lg font-semibold">ðŸŽ‰ Advertising in IPL 2025 on Jio Cinema</p>
    <p>Packages Start at 5 Lakhs</p>
  </div>
);

const App = () => {
  return (
    <div>
      <Navbar />
      <HeroSection />
      <AdBanner />
    </div>
  );
};

export default App;
